INSERT INTO `edu_comment` VALUES ('1195251382720700418', '0', '1192252213659774977', 'java基础课程：test', '1189389726308478977', '1', '尼古拉斯', NULL, '前面，我们解释了BigDecimal的equals方法，其实不只是会比较数字的值，还会对其精度进行比较。\r\n\r\n所以，当我们使用equals方法判断判断两个数是否相等的时候，是极其严格的。\r\n\r\n那么，如果我们只想判断两个BigDecimal的值是否相等，那么该如何判断呢？\r\n\r\nBigDecimal中提供了compareTo方法，这个方法就可以只比较两个数字的值，如果两个数相等，则返回0。', 0, '2019-11-15 16:05:11', '2019-11-15 16:05:11');
